import React from "react";
import MasonryItem from "./MasonryItem";

const MasonryColumn = () => {
  return (
    <div
      onClick={e => {
        e.target.style.flex = "2";
      }}
      className='masonry-col'
    >
      <MasonryItem />
      <MasonryItem />
      <MasonryItem />
    </div>
  );
};

export default MasonryColumn;
